    "content": "<ComponentPreview name=\"button\" withRecipe />\n\n## Installation\n\n<Steps>\n### Install the following dependencies\n\n```bash npm2yarn\nnpm i @radix-ui/react-slot\n```\n### Copy and paste the following code into your project\n\n<ComponentSource name= \"button\"/>\n\n### Update the import paths to match your project setup\n\n</Steps>\n\n## Usage\n\n```tsx\nimport { Button } from '@/components/ui/button/button'\n```\n\n```tsx\n<Button variant=\"default\" size=\"default\">\n  Button\n</Button>\n```\n\n## Recipe\n### Usage\n```tsx\nimport { button, type ButtonVariantProps } from '@styled-system/recipes'\n```\n```tsx\n<button className={button({ variant: 'outline', size: 'default' })}>Button</button>\n```\n\n### Link\n\n```tsx\nimport { button } from '@styled-system/recipes'\n```\n```tsx\n<Link className={button({ variant: 'outline' })}>Click here</Link>\n```\n\nAlternatively, you can set the asChild parameter and nest the link component.\n```tsx\n<Button aschild>\n  <Link href=\"/login\">Login</Link>\n</Button>\n```\n\n## Examples\n### Default (Primary)\n\n<ComponentPreview name=\"button\" file =\"primary\" />\n\n### Outline\n\n<ComponentPreview name=\"button\" file=\"outlined\" />\n\n### Dashed\n\n<ComponentPreview name=\"button\" file=\"dashed\" />\n\n### Link\n\n<ComponentPreview name=\"button\" file=\"link\" />\n\n### Text\n\n<ComponentPreview name=\"button\" file=\"text\" />",
    "title": "Button",
